import './App.css';
import React, { useState, useEffect } from 'react';
import './chat.css'
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import BookingSystem from "./BookingSystem";

function App() {
    // user_id will be taken from token in backend it just for testing purpose
    const [formData, setFormData] = useState({ name: "", url: "", extn: '', user_id: 2 });
    const [message, setMessage] = useState('');
    const [list, setList] = useState([]);

    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    useEffect( () => {
        (async () => {
            const movieList = await axios.get('http://localhost:8080/public/movie-list');
            if(movieList && movieList?.data && movieList?.data?.data){
                setList(movieList?.data?.data);
            }
        })()
    })
    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post("http://localhost:8080/public/create", formData);
            setMessage(response?.data.message);
        } catch (error) {
            setMessage(error.message);
        }
    };


    const handleDelete = async (e) => {
        e.preventDefault();
    }
    return (
        <>
            <BookingSystem />
        </>
    )
}

export default App;
